export default [
    {
        type: "content",
        fontSize: "xl",
        data: [
            {
                text: "Consultel Group is coming together with BGUS for efficient and intelligent business solutions with authentic integrity.",
                textAlign: "justify"
            },
            {
                text: "Consultel Group is a global IT consultancy that delivers scalable, secure technology solutions to businesses worldwide, including brands such as Consultel Cloud, Consultel AI, Consultel Networks, and Consultel Managed Solutions.",
                textAlign: "justify"
            },
            {
                text: "The four brands are dedicated to and focused on four different areas of Information Technology",
                textAlign: "justify"
            },
            {
                text: <span><b>1) Consultel Cloud</b> - Consultel Cloud delivers private cloud to businesses either as a standalone solution or centralize data and complement an organization’s hybrid, multi-cloud strategy.</span> ,
                textAlign: "justify"
            },
            {
                text: <span><b>2) Consultel AI</b> - Consultel AI provides automation tools, quality checking, compliance checking, safety controls, and facial recognition technologies to businesses across Australia.</span>,
                textAlign: "justify"
            },
            {
                text: <span><b>3) Consultel Managed Services</b> - Consultel Managed Services brings the best of breed security solutions and delivers real-time security protection, which helps organizations establish compliance and reduce overall security risk.</span>,
                textAlign: "justify"
            },
            {
                text: <span><b>4) Consultel Networks</b> - Consultel Networks designs, configures, and deploys cost-effective network solutions that meet organizations’ interconnection needs in a continually evolving technology landscape.</span>,
                textAlign: "justify"
            },
            {
                text: "Consultel Group and BG Unified Solutions, working on the principles of customer satisfaction, cost-effectiveness, and reliability, are advancing through to provide high-end expert solutions for your enterprise.",
                textAlign: "justify"
            },{
                text: "Mutual Vision... Partners in Growth!!",
                textAlign: "justify",
                fontWeight:"800",
                fontSize: "2xl",
                mt: "32px"
            },
        ]
    }
]
